import { StyledProjectSection } from "../styles/Projects.styled";
import ProjectCard from "./ProjectCard";
import Emolock from "./../assets/projects/emolock_cover.png"
import { useTranslation } from "react-i18next";

export default function ProjectSection() {
    const [t] = useTranslation("global");
    const projects = t('projects', { returnObjects: true });

    return (

        <StyledProjectSection>
            <h1>Personal Projects</h1>
            <ProjectCard name={projects[0]} imgCover={Emolock}></ProjectCard>
            <ProjectCard name={projects[1]} imgCover={Emolock}></ProjectCard>

        </StyledProjectSection >
    )
}
